import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import './Home.css';
 // Ensure this path is correct relative to Home.js

const Home = () => {
  return (
    <div className="home-container">
      <Navbar />
      <div className="content">
        <img src="frontend\public\images\online-logo.png" alt="Online G Logo" className="logo" />
        <h1 className="welcome-text">Welcome to Grievance Website</h1>
      </div>
      <Footer />
    </div>
  );
};

export default Home;
